El Benny (OST)

Brought to you by TQMP
The Quality Music Project

El Benny is a Cuban film released in 2006. It is a fictional story based on the life of the famous Cuban musician Benny More. It includes new versions of his songs performed by musicians including Chucho Valdes, Juan Formell, Haila and Orishas.

Benny More is considered by many fans of Cuban music as the greatest Cuban singer of all time. He was gifted with an innate musicality and fluid tenor voice which he colored and phrased with great expressivity. More was a master of all the genres of Cuban music, including son montuno, mambo, guaracha, guajira, cha cha cha, Afro-Cuban, cancion, guaguanco, and bolero.

&quot;He was a showman and he was the greatest of them all. No one else came near&quot; - Compay Segundo.

